import './App.css';


function App() {
  return (
    <div className="App  mx-auto flex flex-col w-full h-screen bg-gradient-to-br from-blue-500 to-green-500">
      <div className='card flex flex-col'>
        <img src="../images/pngwing.com.png" alt="" />
      </div>
    </div>
  );
}

export default App;
